import React from "react";

const Logout = () => {
  return (
    <>
      <div className="container">
        <div className="row ">
          <div className="col-md-6 offset-md-3">
            <h1 className="text-center display-4 mt-5">Logout </h1>
          </div>
        </div>
      </div>
    </>
  );
};

export default Logout;
